CortanaConsentPanel.Description:
Aby Cortana mogła odpowiadać na twoje pytania, przypominać ci o ważnych rzeczach i pomagać w bardziej spersonalizowany sposób, zezwól jej na gromadzenie i wykorzystywanie takich informacji o sobie, jak:

lokalizacja i historia lokalizacji;

kontakty, dane kalendarza oraz treść i historia komunikacji z wiadomości, czatu i aplikacji;

historia wyszukiwania i inne informacje na urządzeniu
